import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes, Navigate} from 'react-router-dom'
import GoogleLogin from './GoogleLogin';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route to='/login' element={<GoogleLogin/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
